  \"Environmental contaminants in fish from the Nashua River - Fort Devens, Ayer,
  Massachusetts\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:48:55.340326\",\n\t\"name\": \"environmental-contaminants-in-fish-from-the-nashua-river-fort-devens-ayer-massachusetts\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"For decades, the Nashua River received
  environmental pollutants from non-point and point sources that included industrial
  entities, municipalities, and military activities. Fort Devens, a former U.S. Army
  installation and currently a Superfund Site, is divided by the river in Ayer, Massachusetts.
  Between August 9 and 11, 1994, in a 2.5-mile section of the Nashua River that included
  two Fort Devens waste disposal sites and a former sewage disposal plant, USFWS personnel
  used electrofishing methods and trot lines to collect 43 fish from three trophic
  levels. Organochlorine and trace element concentrations were determined by USFWS
  contract analytical laboratories in 52 tissue samples - 28 fillet and 15 composite
  carcass samples (body minus fillet) of largemouth bass (Micropterus salmoides),
  brown bullhead (Ameiurus nebulosus), and yellow bullhead (Ameiurus natalis), and
  9 wholebody composite samples of yellow perch (Perca flavescens). Fillet and carcass
  data of bass and bullhead were combined to estimate wholebody concentrations.\",\n\t\"license_title\":
